import "/ite"

function item({ id, title, price, picture }){
    return(
        <div id="div">
            <h1 id="titulo">{title}</h1>
            <h2 id="id">{id}</h2>
            <img id="image" src = {picture}/>
            <h6 id="precio">{price}</h6>
            <button>Ver producto</button>
        </div>        
        
    );
}

export default item;
